import {IconButton} from "@mui/material";
import React from "react";
import CloseIcon from '@mui/icons-material/Close';
import {FormControl} from "./formControl.component";
import {Trigger} from "../types/methods.type";

export function DeleteFilter({deleteFilter}:{deleteFilter:Trigger}) {
    return <FormControl width={42}>
        <IconButton color="primary" aria-label="upload picture" component="span" onClick={deleteFilter}>
            <CloseIcon />
        </IconButton>
    </FormControl>;
}
